INSERT INTO `klasse_kommentar` (`klasse_kommentar_id`, `klasse_id`, `kommentar`) VALUES
(1, 4, 'Vi vil gerne tage egne vandprøver i sensommeren. Hvis muligt send venligst info'),
(2, 20, 'vi vil gerne tage vandprøven i sensommeren, så send venligst materiale på forhånd'),
(3, 49, 'Booket sammen med Heidi Nystrand. Oprindelig sagsnr. F14-01'),
(4, 55, 'Én elev gennemgår en stor operation i ryggen 1-2 mdr inden besøget og må forventes at få lidt lang snor mht evnen til at sidde på en stol osv.'),
(5, 56, 'Ombooket, læreren HAR modtaget indsamlingskit, men pgha efterårsferie ændrede han datoen'),
(6, 60, 'Klassen er 3y BI.'),
(7, 61, 'Vi har to A niveau hold med 2g med 8 elever og 3g med 25 elever'),
(8, 64, 'Holdet er et hf-enkeltfagshold på B-niveau - Altså vokse kursister!'),
(9, 65, 'bio b.'),
(10, 78, 'Det er en dygtig klasse.'),
(11, 79, 'Henvisning til sag F14-13 Vi havde ikke skrevet den korrekte dato i vores kalender. Vi har desuden en elev, der er nyligt rygopereret, som nok ikke kan sidde ned så længe af gangen. Bare så der er forståelse for, at hun evt. går rundt, ligger ned eller lignende'),
(12, 82, 'Vi har haft en del datobytningsforvirring, som også har involveret parallelholdet i biologi med Maria Steinhausen - også fra Helsingør Gymnasium. Det betyder ikke så meget, udover at jeg gerne vil bemærke, at vores prøver er de, som er taget fra "Politisøen" i Helsingør. Så lad ikke booking-koden forlede Jer til at tro, at vi skal behandle Maria Steinhausens prøver :-) hilsen OLe Carsten Pedersen'),
(13, 83, 'Klassen har biologi på B-niveau'),
(14, 86, '1 ekstra hold på 18 elever fra samme gym er tilmeldt. Booking ændret d. 14. august 2014'),
(15, 87, '1 ekstra hold på 18 elever fra samme gym er tilmeldt. Booking ændret d. 14. august 2014'),
(16, 91, 'Det er et hold fra læreruddannelsen, der har biologi som undervisningsfag. Tager kontakt pr. mail. Vigtigt for mig at få reserveret dagen i første omgang'),
(17, 92, 'Biologi studieretning A niveau'),
(18, 96, 'Det er et hold der kommer ind Det er mange elever, men de er meget rolige'),
(19, 97, 'Det er et hold der kommer ind Det er mange elever, men de er meget rolige'),
(20, 101, '2 hold. Det ene hold 2g (9 elever) det andet hold 3g (11 elever). Begge hold på A-niveau. '),
(21, 115, 'OBS: to klasser fra to forskellige gymnasier. De skal have tilsendt to kits. Det ene til Køge, det andet til Tine Tønnes SørensenHøng Gymnasium og HFHovedgaden 2 4270 Høng'),
(22, 119, 'Almindelig ''Papegøjeklasse'' med sproglige elever'),
(23, 122, 'Vi kommer med 2 klasser, en biotek A på 11 elever og en Biologi C på 19 elever. Jeg er lærer for dem begge og vil sørge for at de har hørt om DNA og PCR forinden. 1 elev er kørestolsbruger, som har en medhjælper med.'),
(24, 134, 'Jeg har fået et vandopsamlingssæt udleveret på Big Bang konferencen. Jeg sender noget vand ind i slutningen af april.'),
(25, 136, 'Den anden lærer er kemilærer i bioteknologi, og hedder Jens Sveistrup'),
(26, 138, 'Holdet jeg tænker på er 2g Biologi B , der er 12 elever. Imidlertid kunne jeg tænke mig også at deltage samtidigt med 12 Biologi A-elever . Begge dele kræver imidlertid godkendelse fra skolen som jeg straks vil forespørge om Dvs jeg ønsker at reservere dagen. Skulle dagen være optaget vil torsdag d 3 eller fre d 4-9 / uge 36 også være interessant mvh bente bregnbak.'),
(27, 146, 'Jeg kender ikke klassens størrelse endnu'),
(28, 147, 'Jeg kender ikke klassens størrelse endnu'),
(29, 148, 'Klassen har i april underøgt søens kvalitet ved undersøgelse af plante- og dyreliv, iltmåling, BI5, sigtdybde mm Undersøgelsen er del af et løbende samarbejde mellem Allerød Gymnasium og Grundejerforeningen omkring søen, som glæder sig til at høre resultatet af eDNA analyserne'),
(30, 154, 'Aftalt starttidspunkt 9.30 (ved Andreas)'),
(31, 159, 'Vi har tidligere booket en forløb, men måtte aflyse, og har derfor genbooket._x000D_ Vi har indsendt vandprøver. Det oprindelige bookingnummer var F14-85.'),
(32, 167, 'Der er tale om to studieretninger: Biologi og bioteknologi'),
(33, 168, 'Klassen er på en naturvidenskabelig studieretning med Bio A, kemi B og Mat B og er generelt både dygtige og ambitiøse udi det naturvidenskabelige så bare fyld på:-)'),
(34, 169, 'Klassen er på en naturvidenskabelig studieretning med Bio A, kemi B og Mat B og er generelt både dygtige og ambitiøse udi det naturvidenskabelige så bare fyld på:-)'),
(35, 171, '1 hørehæmmet elev. Evt. følger tolk med'),
(36, 172, 'Der er en hørehæmmet elev i klassen, så der vil evt. være en tolk med. Jeg har haft sendt en tilmelding før sommerferien, som jeg afbestilte igen. Jeg fik tilsendt prøverør mv. inden jeg fik afbestilt. Så hvis vi skal indsamle vandprøve, har jeg fået et kit. Vi skal rejse retur til Vejle fredag eftermiddag med DSB frirejse. Jeg har endnu ikke fået billetterne. Er der mulighed for, at vi kan starte lidt tidligere, hvis det bliver vanskeligt at få det til at hænge sammen med vores hjemrejse?'),
(37, 177, 'Biologi A'),
(38, 178, 'Biologi A'),
(39, 181, 'Vi har i foråret indsamlet og indsendt prøve fra vores lokalområde, Kulsbjerg - og det håber vi jo meget at vi selv kan komme til at analysere!'),
(40, 182, 'Klassen har biologi på B-niveau.'),
(41, 188, 'Dette er et IB biologi hold og de skal meget gerne undervises på engelsk; material behøver ikke at være på engelsk, da alle har modtaget undervisning i sporget dansk.'),
(42, 190, 'Incl 8 elever fra Aurehøj'),
(43, 192, 'Meget gerne det forløb om livet i drikkevand, da det passer bedre til hvad klassen har om for tiden, som netop er bakterier i vores omgivelser, og som organisme'),
(44, 193, 'biologi B niveau Vi indsamler DNA i august, har et prøvesæt!'),
(45, 200, 'Klassen kender de grundlæggende DNA-teknikker.  '),
(46, 203, 'Ombooket, fra F15-018. Vi vil gerne se på prøver fra Bølle Sø eller Avn Sø, prøver er sendt ind fra Gorm Clausen DL_F15-018_2'),
(47, 209, 'Dette er en ombookning. Oprindeligt skulle vi komme d. 28.1, så blev det d. 22.1 og nu altså den 21.1. Vores oprindelige bookingnummer DL_F14-96 Vi har indsendt prøver både fra en sø og fra vandhanevand.'),
(48, 215, 'En Team Danmark klasse som har morgentræning denne dag, så hvis øvelsesstarten kan rykkes til kl. 9.30- 9.45 vil det være fint.'),
(49, 216, 'Klassen har biologi på B-niveau'),
(50, 218, 'Dagen er booket som en del af et projekt vi kalder "Superbiologer". Eleverne kommer fra 8 forskellige 1. hf klasser - og de har meldt sig frivilligt til arrangementet. Da eleverne kommer fra 8 forskellige klasser (med forskellige lærere) har de ikke haft en fælles introduktion til dagen. Alle eleverne kender til cellers opbygning, DNA''s opbygning og har lavet forsøg med elektroforese. De har biologi på C-niveau._x000D__x000D_Inden sommerferien sendte jeg vandprøver til jer._x000D__x000D_Mvh Helle '),
(51, 220, 'Vi er to A-niveau hold. Det ene hold (9 elever) har biologi på A-niveau og det andet hold (16 elever) har bioteknologi på A-niveau._x000D__x000D_Vi kommer fra Kolding i Jylland, men den kommune findes ikke i jeres oversigt. Betyder det at jyder ikke kan få adgang til jeres undervisning???_x000D__x000D_Venlig hilsen_x000D_Merete Greniman'),
(52, 223, 'Gymnasietjenesten/BEKL: Oprindeligt forløb den 13/11-2015 rykket til 24/2 efter henvendelse fra lærer. Lærers bemærkninger 12/10-2015: ”Klassen har biologi på B-niveau. Vi har taget vandprøve fra Schweizersøen i Frederiksberg Have, som vi sendte til jer den 30/9. På den er vores besøgsdato markeret som 13/11. Vi mangler endnu at tage prøven fra gymnasiets postevand'),
(53, 224, 'den med ferskvandsdyr i søer (Furesøen): livet i et snapseglas'),
(54, 227, 'Klassen har den basale viden om genetik inden besøget.'),
(55, 228, 'Biologi B'),
(56, 229, 'Eleverne har Biologi A i studieretningen. Der er to udvekslingsstudenter (en fra USA og en fra Argentina)'),
(57, 232, 'Eleverne er en masterclass i biologi og bioteknologi, hvor eleverne kommer fra Silkeborg, Svendborg og Næstved Gymnasium. De er dygtige og vil gerne udfordres. Hvis I har et ekstra fagligt gear må I gerne bruge det.'),
(58, 233, 'Eleverne er en masterclass i biologi og bioteknologi, hvor eleverne kommer fra Silkeborg, Svendborg og Næstved Gymnasium. De er dygtige og vil gerne udfordres. Hvis I har et ekstra fagligt gear må I gerne bruge det.'),
(59, 234, 'Eleverne er en masterclass i biologi og bioteknologi, hvor eleverne kommer fra Silkeborg, Svendborg og Næstved Gymnasium. De er dygtige og vil gerne udfordres. Hvis I har et ekstra fagligt gear må I gerne bruge det.'),
(60, 235, 'Jeg har rettet denne booking til d. 10/3 fra en tidligere booking d. 3/3 - efter mailhenvendelse fra læreren. /Mia 17/11'),
(61, 237, 'Jeg skal nok have gennemgået alt det faglige relevante for klassen inden besøget. Vh Bo'),
(62, 238, 'OBS! Prøve: DL_GYM_008, indsamlet d. 7.6.2015 af Niels J. Willumsen. To hold: 3.g biotek 19 elever, 1.g biologi 11 elever'),
(63, 239, 'Det bliver en studieretningsklasse med Biologi på A-niveau, og matenmatik på A og kemi på B. Klassen er ikke dannet endnu. Det sker først efter nytår, så derfor kan jeg ikke angive antal elever præcist, men det bliver sikkert en hel klasse. '),
(64, 240, 'Biologi A, KemiB sk´tudieretning._x000D_Da vi kommer med tog fra Helsinge vil vi gerne starte 9.15 hvis det er muligt '),
(65, 241, 'Der er tale om et valgfag Biologi på B-niveau. Der er enkelte kursister som er 1. års elever. Da valgfaget netop er startet op (januar 2016) er kursisttallet forbundet med en smule usikkerhed. På nuværende tidspunkt er der tilmeldt 32 til holdet. Er det i orden at give et kursisttal per 1. marts 2016?'),
(66, 242, 'Jeg skal nok have gennemgået alt det faglige relevante for klassen inden besøget. Vh Bo'),
(67, 243, 'Vi glæder os.   Vh.  Peter Jensen. '),
(68, 248, 'Har ej indsendt prøver (men prøve indsendt af Vagn Rasmussen, Allerød; DL_GYM_010 /Marie)'),
(69, 249, 'Forløbet kommer til at afslutte et forløb om økologi, samt være opsummering på teori om evolution, DNAreplikation og proteinsyntese.'),
(70, 251, 'Evt DL_GYM_003, tidligere booking 15-9'),
(71, 253, 'Klassen har biologi på A-niveau'),
(72, 255, 'Jeg har booket en dato den 10. december som jeg gerne vil aflyse, men jeg har i den forbindelse allerede modtaget et indsamlingskit. Mange hilsner Katrine'),
(73, 259, 'Vi har ikke selv vandprøve med, men benytter jeres. er det ok?_x000D_\nBekræftet"'),
(74, 261, 'Klassen er en international IB klasse, så det normale undervisnings sprog for dem er engelsk, men de fleste forstår noget dansk. Så ligesom sidst vi var på besøg kunne det være fantastisk med samme material (på dansk) men selve underviningen på engelsk? mvh, Christina'),
(75, 262, 'Det er en 1g-klasse med studieretning med biologi på A-niveau. '),
(76, 263, 'Tidligere booking 15-9'),
(77, 264, 'Klassen har biologi på C-niveau. De går på en naturvidenskabelig studieretning, og det er generelt en dygtig klasse'),
(78, 265, 'Dette er en IB klasse og vi vil værdsætte det voldsomt, hvis det kan lade sig gøre at gennemføre det meste af dagen på engelsk :o)'),
(79, 269, 'Hej Jeg var med stor succes hos jer med min gymnasieklasse i 3 g. Med denne klasse har jeg så ikke endnu nået at tage vandprøver- men det kan måske godt nås i april? Vi vil dog så finde en anden prøvestation, da vi kun fandt lille vandsalamander i Kulsbjerg-søen. mvhJeppe Mordhorst');
